import React, { Component } from "react";
import PropTypes from "prop-types";
import "../CSS/Week.css";

class Week extends Component {
  constructor(props) {
    super(props);
    state = {};
  }
  WeekDates = () => {};
  render() {
    return (
      <div>
        {this.WeekDates}
        <div>
          <Button
            class="lefty"
            variant="contained"
            color="primary"
            startIcon={<ArrowBackIosIcon />}
            onClick={this.WeekBack}
          ></Button>
        </div>
        <div>
          <Button
            variant="contained"
            color="primary"
            class="righty"
            endIcon={<ArrowForwardIosIcon />}
            onClick={this.WeekBack}
          ></Button>
        </div>
      </div>
    );
  }
}

export default Week;
